import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('domcontentloaded');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for product cards to be rendered
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Extract all product prices
    const prices = await page.$$eval('.product-price', priceElements => {
      return priceElements.map(element => {
        const text = element.textContent.trim();
        // Extract numeric price value (remove $ symbol and convert to number)
        return parseFloat(text.replace('$', ''));
      });
    });

    // Take screenshot of products section
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_prices.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_prices.png'));

    return {
      success: true,
      action: "Extracted all product prices from the page",
      extractedData: {
        prices: prices,
        count: prices.length
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to extract product prices",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
